import './css/App.css';
import "./css/nullstyle.css"
import MainScreen from './js-components/Mainscreen/main-screen';
function App() {
	return (
		<BrowserRouter>
		<div className="wrapper">
			<div className="content">
				<MainScreen/>
			</div>
		</div>
		</BrowserRouter>
	);
}

export default App;
